// src/pages/HoldingsPage.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';

function HoldingsPage({ userId }) {
  const [holdings, setHoldings] = useState([]);

  useEffect(() => {
    // Примерна заявка за холдинги
    axios.get(`/api/holdings/${userId}`)
      .then(response => setHoldings(response.data))
      .catch(error => console.error('Грешка при зареждане на холдингите:', error));
  }, [userId]);

  return (
    <div>
      <h2>Холдинг</h2>
      <ul>
        {holdings.map(holding => (
          <li key={holding.symbol}>
            {holding.symbol}: {holding.amount} {holding.symbol}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default HoldingsPage;
